    public HashMap<String, String> trans = new HashMap<String, String>();
    public HashMap<String, String> site_trans = new HashMap<String, String>();
    public void onCreate(Bundle savedInstanceState){
        super.onCreate(savedInstanceState);
        setContentView(R.layout.single_drug);

        Intent intent = getIntent();
        String name = intent.getStringExtra("drug_name");

        ImageView sorry_img = (ImageView)findViewById(R.id.imageView);
        mWebView = (WebView) findViewById(R.id.webView);
        TextView site = (TextView)findViewById(R.id.textView);
        sorry_img.setVisibility(View.GONE);
        mWebView.setVisibility(View.VISIBLE);


        onTrans1();
        onTrans2();
        onTrans3();

        onSite1();
        onSite2();
        onSite3();
        // 웹뷰 시작

        if(trans.get(name).equals("약코드없음x")){
            mWebView.setVisibility(View.GONE);
            sorry_img.setVisibility(View.VISIBLE);
            site.setText("죄송합니다.\n해당 약은 현재 공개된 정보가 없습니다.");
        }
        else{
            site.setText(site_trans.get(name) + "에서 제공되는 정보입니다.");
            site.setTextColor(Color.WHITE);
            site.setBackgroundColor(Color.BLACK);
            site.setTextSize(20);
            mWebView.setWebViewClient(new WebViewClient()); // 클릭시 새창 안뜨게
            mWebSettings = mWebView.getSettings(); //세부 세팅 등록
            mWebSettings.setJavaScriptEnabled(true); // 웹페이지 자바스클비트 허용 여부
            mWebSettings.setSupportMultipleWindows(false); // 새창 띄우기 허용 여부
            mWebSettings.setJavaScriptCanOpenWindowsAutomatically(false); // 자바스크립트 새창 띄우기(멀티뷰) 허용 여부
            mWebSettings.setLoadWithOverviewMode(true); // 메타태그 허용 여부
            mWebSettings.setUseWideViewPort(true); // 화면 사이즈 맞추기 허용 여부
            mWebSettings.setSupportZoom(true); // 화면 줌 허용 여부
            mWebSettings.setBuiltInZoomControls(true); // 화면 확대 축소 허용 여부
            mWebSettings.setLayoutAlgorithm(WebSettings.LayoutAlgorithm.SINGLE_COLUMN); // 컨텐츠 사이즈 맞추기
            mWebSettings.setCacheMode(WebSettings.LOAD_NO_CACHE); // 브라우저 캐시 허용 여부
            mWebSettings.setDomStorageEnabled(true); // 로컬저장소 허용 여부

            mWebView.loadUrl(trans.get(name));
        }
    }
